import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
    return ( 
        <div>
            <div className="navbar">
         <Link to="/homepage" style={{textDecoration: 'none',color: 'black'}} ><div className="logo">Courses Webpage</div></Link>
       <Link to="/login" > <div class="box-1">
  <div class="btn btn-one">
    <span>Signup</span>
  </div>
</div></Link>
      </div>
        </div>
     );
}
 
export default Navbar;
